import http from "./http-common";
class DataService {
  create(data) {
    //return http.get("/simulado", data);
    return http.post("/simulado",data);
  }

  retrieve(){
    return http.get("/");
  }

  teste(){
    return http.post("/teste",data);
  }
}
export default new DataService();
